import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import Navigation from './Navigation';


const Home = () => {
    return (
        <div>
            <Navigation/>
            <h1>Présentation</h1>

            <p>Je présente ici différents films, serie et animé que j'ai aimé.</p>

        </div>

    );
};

export default Home;
